import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Idea from '../../componentes/idea/Idea';

const Home = () => {
  const [copia, setCopia] = useState([]);
  setCopia([]);

  const token = document.cookie.replace('token=', '');
  useEffect(() => {
    let datos;
    axios.get('http://localhost:5000/v1/api/idea', {
      headers: {
        'authorization': token

      }

    })
      .then(dat => {
        datos = dat.data;
        setCopia(datos);

      }, [])
      .catch(console.log)
  }, [])



  return (
    <div className='container'>
      <h1 className='mt-3 mb-3'>Ãšltimas ideas</h1>

      {
        copia &&
        copia.map((idea) => <Idea datos={idea} key={idea._id} />)
      }



    </div>
  )
}

export default Home
